import { lazy, Suspense } from "react";
import Nav from "./Nav";
//import Cards from "./Cards";
const Cards = lazy(() => import("./Cards"));


export default function Home(){


    return (
        <div className='home'>
            <Nav/>
            <Suspense fallback={<h1>cargando...</h1>}>
                <Cards/>
            </Suspense>
        </div>
    )
}
